-- 
-- Structure for Table [CRPC_MAIN]
-- 

CREATE TABLE IF NOT EXISTS crpc_main(
case_yr int  DEFAULT '0'   NOT NULL ,
case_no bigint  DEFAULT '0'   NOT NULL ,
case_date date  NOT NULL ,
section varchar(30)  NOT NULL ,
subject text  NOT NULL ,
magistrate_code int,
magistrate_name varchar(50)  NOT NULL ,
next_date date,
old_caseno varchar(20),
Police_station int,
status varchar(20)  NOT NULL ,
dispose_date date,
entered_by varchar(50),
PRIMARY KEY (case_yr,case_no)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



